A great aspect of an Action is its reusability. Let's have a closer look at the user:group completion of chown . It uses ActionMultiParts which implicitly splits the current word (or part of it as these can be nested as well). The parts themself are completed with ActionUsers and ActionGroups . Here the first one is invoked explicitly to add a : suffix to the inserted values. // ActionUserGroup completes system user:group separately
// bin:audio
// lp:list
func ActionUserGroup() carapace.Action { return carapace.ActionMultiParts(":", func(c carapace.Context) carapace.Action { switch len(c.Parts) { case 0: return ActionUsers().Invoke(c).Suffix(":").ToA() case 1: return ActionGroups() default: return carapace.ActionValues() } })
}

